import React, { Component } from 'react';
import NavButton from '../Components/nav-btn.js';

import '../style/navDashboard.css';

class NavDashboard extends Component {
    state = {  }
    render() { 
        return (
            <div className="nav-dashboard">
                <NavButton text="Home" />
                <NavButton text="Campaigns" />
                <NavButton text="Reports" />
                <NavButton text="Influences" />
                <NavButton text="Messages" />
                <NavButton text="Settings" />
            </div>
        );
    }
}

export default NavDashboard;
